import React from "react";
import "./App.css";

import { motion } from "framer-motion";

import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  const variants = {
    visible: { opacity: 1 },
    hidden: { opacity: 0 },
  };
  return (
    <motion.div initial={{ x: 0 }} animate={{ x: 100 }}>
      <h1>Hello My Name is Manuel!!!</h1>
    </motion.div>
  );
}

export default App;
